  \"2013-03-25T23:28:10.336876\",\n\t\"name\": \"usda-national-agricultural-statistics-service-2008-new-york-cropland-data-layer\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The USDA, NASS Cropland Data Layer (CDL)
  is a raster, geo-referenced, crop-specific land cover data layer with a ground resolution
  of 56 meters. The CDL is produced using satellite imagery from the Indian Remote
  Sensing RESOURCESAT-1 (IRS-P6) Advanced Wide Field Sensor (AWiFS) collected during
  the current growing season. Ancillary classification inputs include: the United
  States Geological Survey (USGS) National Elevation Dataset (NED), the USGS National
  Land Cover Dataset 2001 (NLCD 2001), and the National Aeronautics and Space Administration
  (NASA) Moderate Resolution Imaging Spectroradiometer (MODIS) 250 meter 16 day Normalized
  Difference Vegetation Index (NDVI) composites. Agricultural training and validation
  data are derived from the Farm Service Agency (FSA) Common Land Unit (CLU) Program.
  The NLCD 2001 is used as non-agricultural training and validation data. The strength
  and emphasis of the CDL is agricultural land cover. Please note that no farmer reported
  data are derivable from the Cropland Data Layer.\",\n\t\"license_title\": null,\n\t\"extras\":
